(2771, 'Dr. Ashok Jangra\r\nDOJ: 29th August, 2016\r\nAffiliation: Department of Pharmacology, KIET School of Pharmacy\r\nEducation: M.S. Pharm. (NIPER-S.A.S. Nagar, 2010-2012), PhD (NIPER-Guwahati, 2012-2016)', 'Behavioural and Molecular Pharmacology, Neurotoxicology', 'B.Pharm, M.Pharm', 'NONE', 'Oral presentations (International Conferences: 2, National Conferences: 3)\r\nPoster presentations (International Conference: 1, National Conferences: 1)', 'NONE', '1. Received International Travel Grant (2015) from Department of Science and Technology (DST), Govt of India, for attending \"Japan Neuroscience Society\" Conference held at Post Island, Kobe, Japan.\r\n2. Received International Travel grant (2015) from Indian Council of Medical Research (ICMR), Govt. of India, for attending \"European College of Psychopharmacology\" conference held at Amsterdam, The Netherlands.\r\n3. Received International Travel grant (2016) from International Brain Research Organisation (IBRO) for attending \"International Neurosicence Winter Conference\" held at Solden, Austria.\r\n4. Awarded scholarship from Ministry of Chemical and Fertilizers, Govt of India, for PhD degree at NIPER-Guwahati.\r\n5. Awarded scholarship from Ministry of Chemical and Fertilisers, Govt of India for PhD at NIPER-Guwahati.\r\n6. Awarded Scholarship from Ministry of Chemical and Fertilisers, Govt. of India for M.S. (Pharm) at NIPER-S.A.S. Nagar.\r\n7. Qualified NIPER-PhD Entrance Exam with 7 Rank.\r\n8. Qualified NIPER-M.S. Entrance Exam with 127 Rank.\r\n9. Qualified GPAT Exam with 282 Rank.\r\n', 'ashok.jangra@kiet.edu', '2016-09-03 01:21:45'),
(3665, 'Dr. Prabhudatt Dwivedi is Associate Professor in the area of Marketing Management. He has completed Master in Management Studies and Ph. D from Motilal Nehru National Institute of Technology, Allahabd. He has fourteen years of academic experience. He has published research papers in reputed international journals published from USA and presented several research papers in national and international conferences. His area of interest is marketing management, marketing research, adoption of technology and human values and Professional Ethics.', 'Marketing Management', 'Marketing Management, Human Values and Professional Ethics, Rural Development ', '(1) \"Adoption of Information and Communication Technology towards the growth of Small and Medium Enterprises: A Case study of Indian Enterprises\" Published in International Journal of Indian Culture and Business Management, Vol.8, No. 2, pp 182-197, 2014\r\n(2) \"Information Technology: A growth navigator for small scale industries in India\" published in Journal of cases on Information Technology,Vol 10, No. 3, pp. 48-57, 2008', '(1) \"E-Government at district Level: A case study of Jodhpur District\" presented at international conference on E- Governance at IIM Banglore, during 22-24 April 2010.\r\n(2) Information Technology: Feasibility of adoption and implementation in SSI in India\" published in the proceedings of GLOGIFT 08  at Stavens Institute of Technology, New Jersey, USA during 14-16 June 2008.\r\n(3) \"Towards Effective Implementation of Right to Information Act\" presented and published in the proceedings of ICEG 08 at University of Hyderabad during 28-30 Dec. 2007.\r\n(4) \"Challenges of E-Government implementation in India\" published in the proceedings of the international conference at IIT Delhi During 18-20 Dec.2008.\r\n(5) \"Information Technology: Adoption and implementation in SSI in India\" presented and published in the international conference at UPTU, Noida Campus, during 15-17 Nov 2007.\r\n(6) \"Ethics in Marketing: Need of the hour for fair market practices\" presented in the National Conference at KIET, Ghaziabad in September 2011\r\n(7) \" Protection of Intellectual Property: Information Technology as a  tool\" presented and published in the proceeding of national seminar at Allahabad Degree College, Allahabad during 3-4 February 2007', 'Book Chapter- \" Impact of corruption on the economy of a nation: A study\" published in Book title \"Advances in Management and Technology: Mapping strengths with opportunities\",  McGraw Hills Education Vol.1, pp. 30-33.', '(1) Received \"Award of Excellence\" for outstanding performance and dedication to academics in the year 2008-09 at Krishna Institute of Engineering and Technology, Ghaziabad\r\n(2) Awarded Merit Scholarship for my entire I.Sc. and B.Sc. Course at St. Xavier\'s College, Ranchi ', 'prabhudutt.dwivedi@kiet.edu', '2015-05-28 11:23:37'),
(3670, 'Jyoti Srivastava\r\nAssociate Professor\r\nWork Experience-14 years in teaching\r\nM.Tech ', 'VLSI DESIGN, RENEWABLE ENERGY ', 'Signal and Systems, Sensor and Instrumentation, Basic Electrical Engg., VLSI Design, Network Analysis And Synthesis', 'NONE', '02 in International Conference\r\n04 in National Conference', 'NONE', 'Recieve award from the management of KIET in 2010 for good result.\r\nGATE Qualified in 2014', 'jyoti.srivastava@kiet.edu', '2015-05-30 13:56:04'),
(3674, 'Academic Qualification - B.Tech from Madan Mohan Malviya Engineering College, Gorakhpur ( U.P.) in 1992, M.Tech from IIT Rorkee, in 1994, Pursuing PhD from Jamia Millia Islamia, New Delhi.                                     \r\nExperience - 18 years in teaching, 03 years in Industry. ', 'Specialization in Power electronics and electric drives. Area of interest covers application of power electronics in the areas of electric drive, distributed generation and non conventional energy resources.', 'Electromechanical Energy Conversion -I , Electromechanics Energy Conversion - II , Electric Drives, Electrical Machines, Power Converter - I, Power Converter - II, Non conventional Energy Resources, Electrical and Electronics Engineering Materials, Circuit Theory', '06', '04', 'NONE', 'Achieved Award \"Superior Performance\" in 2014 from KIET', 'ravi.gupta@kiet.edu', '2015-05-28 15:51:09'),
(3679, 'Dr. Neeraj Kumar Gupta is a Professor in the Department of Electrical and Electronic since September 2012. He is also serving as DEAN (ECA) from Feb 2014. Prof. Gupta did his B.Tech from NIT Kurukshetra and received the M.Tech and Ph.D degree from UPTU Lucknow and JMI, New Delhi respectively. His researches are in the areas of Neural Networks, Network-on-Chip, Image Processing and Fuzzy Logic. He has published about thirty nine research papers in referred International and National Journals and proceeding of International and National conference. He is appointed as a Senior Members of IEEE USA. He is Member of Jury Panel of All IEEE-Region 10 (The ASIA PACIFIC REGION) Engineers Humanitarian Challenge. One of the project title: \" facilitation of Medical Expertise in Cancer\" is funded by IEEE USA. He is Received Certificate of Appreciation for superior performance in KIET, Ghaziabad for the Academic Year 2012-13. He is Recognize the innovative and promising concept design for title: \"Records for Life\" by Bill & Melinda Gates Foundation.', 'Neuro-Fuzzy Integrated System with On-line Learning Capability', 'Undergraduate Level:\r\n(a) Design Signal, \r\n(b) Basic of Signals and systems\r\n(c) Microprocessor and its Application\r\n(d) Network Analysis and Synthesis\r\n(e) Advance Control System\r\n(f) Soft Computing\r\n(g) Electrical Circuit and Analysis\r\n(h) Fuzzy Logic\r\n\r\nPostgraduate Level:\r\n(a) Digital Signal Processing\r\n(b) Microprocessor and its Application\r\n(c) Advance Control Systems\r\n', '1. Neeraj Gupta, A.Q. Ansari, \" Design and Simulation of OTA-Bassed Activation and Membership Function for Neurofuzzy Systems\" International Journal of Computational Congition (IJCC), Vol 9, No. 1, pp.1-5, March 2011.\r\n2. Neeraj Gupta, Ekata and S.B. Singh, \"Operational Availability of Marine Vehicle System using Neural Network Approach\" International Journal of Computational Science and Mathematics, vol 2, Number 1 (2010), pp. 91-99.\r\n3. Neeraj Gupta, A.Q. Ansari, \"Backpropagation Algorithm for Neurofuzzy Filter\" International Journal of Computational Cognition (IJCC), Vol 9, No. 3, pp.41-47, Sept 2011. \r\n4. Neeraj Gupta, A.Q. Ansari, \"VLSI Design for Activation and Membership Function for Neuro-Fuzzy Integrated System\" World Applied Science Journal (WASJ), Vol 16. pp. 53-62, 2012.\r\n5. Neeraj Gupta, A.Q. Ansari, \" Neuro-Fuzzy Integrated System with its different domain Application\" International Journal Intelligent Systems Technologies and Applications, Vol 11 No. 3/4, pp. 160-178, 2012.', 'International Conference:\r\n1. J.P. Saini, S.N. Sharan, Gajendra Singh, Neeraj Gupta, \"Design and Application of an Analog Neurofuzzy Logic Controller\" RACE 07, International Conference, Bikaner, India,, 2007.\r\n2. Neeraj Gupta, A.Q. Ansari, \"MIPS-NF Instructions for fourth Generation Processor\" 2nd IEEE International Conference on Computer, Control & Communication, pp. 1-5, 2009.\r\n3. Neeraj Gupta, A.Q. Ansari, \"Noise Cancellation in Hand Free Cellphone using Neurofuzzy filter\" 4th International Conference on computer Application in Electrical Engineering Recent Advance (CERA-09) Indian Institute of Technology Roorkee, pp. 280-283, 2010.\r\n4.Neeraj Gupta, A.Q. Ansari, \"ECHO Cancellation in Cellphone using Neurofuzzy filter\" International conference on advance in computer engineering (ACE-2010), IEEE Computer Society, pp. 188-192, 2010.\r\n5.  Neeraj Gupta, A.Q. Ansari, \" Backpropagation Algorithm for Neuro-Fuzzy Intergrated Systems and its VLSI Design for Neuro Module\" International Conference on Advances in Computing and Communication (ICACC 2011), NIIT Hamirpur, pp. 466-471, 2011.\r\n6. Neeraj Kumar Gupta, A.Q. Ansari, \" Neuro-Fuzzy Integrated System and its VLSI Design for Generating membership Function\" World Congress on Information and Communication Technology, Co-organized by Machine Intelligence Research Labs (MIR Lab) USA and University of Mumbai, pp. 1378-1382, DIO 978-1-4672-0125-1.\r\n7. Neeraj Kumar Gupta, A.Q. Ansari, \" Automated Diagnosis of Coronary Heart Disease using Neuro-Fuzzy Integrated System\" World Congress on Information and Communication Technology, Co-organized by Machine Intelligence Research Labs (MIR Labs) USA and University of Mumbai, pp. 1383-1388, 2011. DIO 978-1-4673-0125-1.\r\n8. Neeraj Kumar Gupta, Ekata, A. Q. Ansari \"Automatic Diagnosis of Asthma using Neurofuzzy and Communication Networks (CICN)\", GLA University, Mathura, PP. 819-823, 2012, Digital Object Identifier: 10/1109/CICN.2012.55.\r\n9. Neeraj Kumar Gupta, Ekata, A. Q. Ansari \"Adaptive Neurofuzzy system for Tuberculosis\" Second IEEE International conference on Parallel, Distributed and Grid Computing (PDGC-2012), Jaypee University of Information Technology, Waknaghat, Solan, pp. 568-573, 2012, DOI:978-1-4673-2924-8.\r\n10. Neeraj Kumar Gupta, Vishal Tyagi \"Finger Tip Controlled Smart Wheelchair using Neurofuzzy Interference System\" IEEE International Conference on Fuzzy Systems (FUZZ-IEEE 2013) at Hyderabad, India (Accepted Paper).\r\n11. Neeraj Kumar Gupta, Vishal Tyagi \"Smart wheelchair using Fuzzy inference System\" IEEE Global Humanitarian Technology Conference (GHTC) at Technolopark, Trivandrum, India.\r\n12. Neeraj Kumar Gupta, Neha Tyagi \" Neurofuzzy Inference System for Stage Classified of Diabetes\" 2014 International Conference on Advance Computing (IACC 2014), PP. 1265-1269, ITM University, Gurgaon, India\r\n13. Neeraj Kumar Gupta, Praveen Kumar Tyagi, Anjali Gupta \"Early Detection of Diabetes Patients using Soft Computing\" 2014 International Conference on Issues and Challenges in Intelligent Computing Techniques (ICICT), KIET, Ghaziabad, 7-8 Feb 2014, pp-174-179.\r\n14. Abhishek Pandey, Neeraj Kumar Gupta \"Stage Determination of Oral Cancer using Neurofuzzy inference System\" 2nd IEEE International Students\' Conference for Electrical, Electronics and Computer Science (SCEECS-2014), NIT, Bhopal, pp-1-5.\r\n15. Neeraj Kumar Gupta, Praveen Kumar Tyagi, Aayush Rastogi \"Neurofuzzy Inference System for Diagnosis of Malaria\" 3rd Internatioinal Conference on Biomedical Engineering and Assistive Technologies (BEATS-2014) at University Institute of Engineering & Technology Punjab University, Chandigarh (Accepted Paper).\r\n16. Ayush Rastogi, Abhishek Nigam, Kopal Jaiswal, Neeraj Kumar Gupta \"Analysis of Relationship between Extracurricular activities and academic performance by computational intelligence\", 2014 Frontiers in Education conference, Madrid, Spain (Accepted paper)\r\nNational Conferences\r\n1. Neeraj Kumar Gupta, J. P. Saini, S. N. Sharan, Ekata \"Design of Fuzzy CMOS Chip\" DTVC-2007 National Conference sponsored by TEQIP, NIT, Hamirpur, VLSI Socity of India (VSI), PP-193-198, 14-15 May 2007.\r\n2. Neeraj Kumar Gupta, Prof. S. N. Sharan, Prof. Gajendra Singh \"Membership function circuit for fuzzy control systems using operational transconductance amplifier\" Proceeding of the AICTE sponsored National Conference on Advances in Electrical Engineering (AEE-06) Nov 29-30, 2006 Department of Electrical Engineering Madhav Institute of Technology, Gwalior, PP-530-533.\r\n3. Neeraj Kumar Gupta, Shailesh S. Sule \"A fuzzy approach to RISC processor\" proceedings of the National conference on Recent Trends in Embadded System & application, Sreenidhi Institute of Science & Technology, Hyderabad, 23-24, 2005.\r\n4. Neeraj Kumar Gupta \"Artificial neural network to hands free mobile\", Proceedings of the National Conference on Trends in Instrumentation and control engineering (TICE-2004), Thapar Institute of Engineering and Technology (TIT), Patiala, Punjab, India, 5-6 February 2004, pp-229-235.\r\n5. Neeraj Kumar Gupta, A. Q. Ansari, \"Hardware implementation of Adaptive Neuro-fuzzy Controller\" 34th National System Conference (NSC-2010) on Systems solutions for Global Challenges: Energy, Environment and Security, NIT, Surathkal, 10-12 December 2010.\r\n6. Neeraj Kumar Gupta, A. Q. Ansari, \"Back propagation Algorithm for Neuro-Fuzzy Integrated System with its Applications\" National Conference on Power, Instrumentation, Energy and Control, Aligarh Muslim University, Aligarh, 12-13 February 2011, pp-191-195.\r\n7. Neeraj Kumar Gupta, Ekata \"Neural Network that learn from fuzzy through interval Mathematics\", National Conference on Futuristic Trends in Engineering and Techlology, 28-29 Jan 2008, pp-48-54.', 'NONE', '1. Received Letter of Appreciation for conducting STC on \"Neurofuzzy System and their VLSI implementation (Using MATLAB and SPICE)\" from Director of KIET, Ghaziabad dated 16-04-2007.\r\n2. Received Letter of Appreciation for conducting workshop on \"Tanner Tools-A complete VLSI Design System\" from Director of KIET, Ghaziabad on dated 27-03-2008.\r\n3. Received Letter of Appreciation for conducting workshop on \"impact of software and hardware growth on medical electronics industry\" from Director of KIET, Ghaziabad on dated 05.04.2011.\r\n4. Received Letter of Appreciation for conducting Summer Training course on \"MATLAB Embadded/ VLSI system and soft computing\" from Director of KIET, Ghaziabad on dated 26-07-2012\r\n5. Received Latter of Appreciation for conducting Short Term Course on \"MATLAB and its engineering applications\" from Director of KIET, Ghaziabad on dated 26-07-2012.\r\n6. Received Letter of Appreciation for conducting short term course on \"Adaptive Neural Fuzzy inference System (ANFIS) and its applications\" from Director of KIET, Ghaziabad on dated 26-07-2012.\r\n7. Received Certificate of Appreciation for superior performance in KIET, Ghaziabad for the Academic Year 2012-13.\r\n8. Recognize the innovative and promising design for title \"Record for Life\" by Bill & Melinda Gates Foundation in the Year 2013.\r\n9. Member of Jury Panel of ALL IEEE-Region10 (The Asia Pacific Region) Engineers\' Humanitarian Challenge for years 2013 and 2014.\r\n10. Appointing as Senior Member of IEEE USA for year 2015.', 'neeraj.gupta@kiet.edu', '2015-05-30 10:18:41'),
(3682, 'Ashish did his engineering from Regional Engineering College, Kurukshetra in Mechanical Engineering discipline in the year 1998. He joined teaching profession and joined Krishna Institute of Engineering and Technology, in the year 2000. KIET sponsored his ME from Delhi College of Engineering, Delhi and also supported his PhD program at Jamia Millia Islamia University, New Delhi. His area of interest is use of different feedstock oil biodiesel in different IC Engines for better engine performance and emission results. He is actively involved in various projects organized by Center of Advanced Studies and research in Automotive and Engineering, Delhi Technological University. He also visited Nigeria two times and assisted FIIRO and NARICT in there Govt.funded R&D Projects. He also received grants of Rs. 13 lacs from AICTE under MODROBS Scheme. ', 'Thermal and Use of Different feedstock oil biodiesel in IC Engine for optimum engine performance with minimum emissions.', 'Engineering Mechanics\r\nThermodynamics\r\nStrength of Material\r\nIC Engines\r\n', '07 in Reputed International journals', '04 in International Conferences', 'NONE', 'Received Rs. 6,00,000/- grant from AICTE under Modrobs Scheme in year 2012-13\r\nReceived Rs. 7,00,000/- grant from AICTE under Modrobs Scheme in year 2010-11.\r\nAssisted National Research Institute for Chemical technology (federal Ministry of Science and Technology) Zaria, Nigeria and FIIRO, Lagos, Nigeria in there govt. aided Projects\r\nDelivered several lectures in a Training Program organized by Center of jatropha Promotion, Jaipur.  \r\n', 'ashish.karnwal@kiet.edu', '2015-05-29 12:05:22'),
(3683, 'Myself Dr. Kunwar Laiq Ahmad Khan and working as Professor and Head, Department of Mechanical Engineering at K.I.E.T. Group of Institutions, Ghaziabad. I have done Ph.D. from Department of Applied Mechanics, IIT Delhi.', 'Engineering Materials,Thermodynamics.', 'Thermodynamics, Refrigeration and Air conditioning, Engineering Materials, Automobile Engineering, Measurement and Metrology, Fluid Mechanics, Theory of Machines, Workshop Practice and many more subjects during last 19 years of teaching.', 'Published research papers in Transactions of IIM, Transactions of PMAI, Applied Surface Science Journals.', 'Presented 8 research papers in International conferences organized by Institutions of repute like IIT Delhi, IIt Madras, IIT Khragpur, IIT Kanpur etc.', 'None', '1. Got sanctioned grant of  Rs10.70 Lacs as project cordinator from AICTE under MODROBES scheme for the modernization of Material Science and Testing la at KIET Ghaziabad.\r\n2. Got sanctioned Grant of Rs. 1.00 lacs from AICTE as coordinator for organizing seminar on Tools and Techniques used for thermal cooling.\r\n3. Got Third prize of cash and certificate for my research paper presented at Internationational Conference by IIT Kanpur.\r\n4. Got University Medal for securing First Position In B.E. (Overall) at A.M.U.Aligarh.\r\n5. Got University Medal for securing First Position in B.E. (Mechanical Engineering) at A.M.U.Aligarh.', 'kla.khan@kiet.edu', '2015-05-29 15:40:53'),
(3686, 'Joined KIET on 10-08-2002 as Lecturer.\r\nAt present working as Associate Professor In ME department.\r\nB.Tech. (Hons.) from REC, Kurukshetra\r\nM.Tech. from REC, Kurukshetra\r\nPh.D.(P) from NIT, Kurukshetra', 'Solar Desalination,\r\nMechanics, Thermal Science', 'Engineering Mechanics\r\nThermodynamics\r\nManufacturing Practices\r\nPower Plant Engineering\r\nIC Engines\r\n', '\"Experimental study on modified single slope single basin active solar still\", Desalination 367(2015) pp. 69-75 (Elsevier with impact factor 3.96)', '\"Parametric investigation of an active solar distillation system\" PETROTECH-14: 11th International Oil & Gas Conference and Exhibition oganized by ONGC.', 'None', '-', 'sandeep.chhabra@kiet.edu', '2015-05-28 14:21:17'),
(3706, 'Acquired M.Sc, M.Phil & Ph.D. degrees in Mathematics .\r\nServing the institute since Sept.,1999.\r\nPresently working as Professor in Mathematics.\r\nMore than 15 years of teaching experience .\r\nAlso involved in the Administrative work of the institute as  Dean (Academics) since Dec.,2014', 'Operation Research ( Reliability)', 'Engineering Mathematics in B.Tech  Ist and IInd year\r\nMathematical Foundation in Computer Science in MCA.\r\nCBNST in M.Tech.(ME)', ' Published 3 research papers  in  International and 5  in National Journal .  ', 'Attended National & International conferences of Mathematics.', 'Co author of the books titled\r\n 1\" Discrete structures and Automata Theory\",published by Alpha Science International Limited ,Oxford , U.K.\r\n2 \" Engineering Mathematics -II\", published by Acme Learning Private Ltd ,Delhi\r\n', 'Letter of appreciation by Hon\'ble Chairman(KIET) for co-authoring book published by Alpha Science International Ltd. , Oxford,U.K. in 2006.\r\nCertificate of appreciation for outstanding result in 2008-09 & highest pass % in mathematics in UPTU\r\nCertificate and letter of appreciation for contribution in FRESCOS\'12 & EPOQUE\'12 resp.\r\nLetter of appreciation by HoD(AS) for maintaining discipline before holi festival in 2014.', 'ritu.gupta@kiet.edu', '2015-05-26 14:32:19'),
(3708, 'M. Sc., Ph. D. (Operation Research), ADSET, DRDBMS, DCA. \r\nServing the Institute since November, 1998\r\nHaving teaching Experience of more than 20 years. Head of Applied Science Department and also involved in various administrative work of Institute as Chief Hostel Warden. ', 'Operation Research', 'Engineering Mathematics, CBNST, Numerical Methods and Computer Programming.', 'Published 08 research papers in various National and International Journals.', 'Attended various conferences of Mathematics.', '\"Engineering Mathematics-II\" published by Acme Pvt. Ltd, Delhi', 'Awarded for long service employee of the Institute\r\nAwarded for outstanding performance for the academic year 2012-13\r\nCertificate of appreciation for outstanding result in 2008-09 and highest pass% in Mathematics in UPTU.', 'cm.batra@kiet.edu', '2015-05-28 16:31:45'),
(3709, 'MA, B.Ed., Ph.D. (Lucknow University)\r\nProficiency in French \r\nHaving teaching experience of more than 30 years', 'English Literature: Modern Drama ', 'Professional Communication, Communication for Management', '-', 'Attended various conferences related to subject and others', '-', 'Best Faculty Award for 100% result\r\nLong Service Award for completion of 10 years in same KIET ', 'kiran.srivastava@kiet.edu', '2015-06-09 14:34:11'),
(3714, 'Dr. Sanjay Sharma is the Professor and Head of Electronics and Communication Engineering Department.He received his B.E. degree in Electronics and Communication Engineering from Madan Mohan Malviya Engineering College(MMMEC),Gorakhpur,M.Tech in Digital Communication and Ph.D in Wireless Communication from department of Electronics and Communication Engineering,Faculty of Engineering and Technology,Jamia Millia Islamia,New Delhi. Dr. Sanjay Sharma joined KIET in August,1999. He has 20 years of Teaching and Research experience.', 'Analog and Digital Signal Processing', 'During his long career at KIET,Dr Sanjay Sharma has taught a number of subjects like Communication Systems, Analog Communication,Digital Communication, Signals and Systems, Principles of Communication, Analog Integrated Circuits,Information Theory and coding, Digital Image Processing, Wireless Communication etc. ', 'Dr. Sanjay Sharma has published 12 research papers in International Journals of repute and 8 papers in reputed National Journals.', 'Dr. Sanjay Sharma has published  20 research papers in proceedings of reputed International and National Conferences in India and abroad.', 'Dr. Sanjay Sharma has authored seven Best Seller Books(National Level). These are: Communication Systems(Analog and Digital), Signals and Systems, Electronics Principles, Computer Networks,Analog Communication Systems, Digital Communication,Digital Signal Processing.', 'Dr. Sanjay Sharma has handled and organized a large number of Administrative assignments as a faculty and also as Head of Department.', 'drsanjaysharma@kiet.edu', '2015-05-28 13:50:29'),
(3722, 'Prof. (Dr.)  Vibhav Kumar Sachan is the Professor & Additional Head of Department of Electronics & Communication Engineering Department at KIET Group of Institutions, Ghaziabad, Uttar Pradesh. He completed his B.Tech. with distinction in Electronics & Instrumentation Engineering from Bundelkhand Institute of Engineering & Technology, Jhansi, UP in  2001,  M.Tech. with distinction in Digital Communication from UPTU, Lucknow, UP in 2006 and Ph.D. in Wireless Sensor Networks from Department of Electronics & Communication Engineering, Faculty of Engineering & Technology, Jamia Millia Islamia, New Delhi, INDIA in  2014. Dr. Sachan has also qualified GATE with All India Rank (AIR) 1120 in year 2003. Dr. Sachan started his career as Lecturer of Electronics & Communication Engineering Department at KIET Group of Institutions, Ghaziabad, Uttar Pradesh in August 2001. ', 'Wireless Communication, Wireless Sensor Networks, Signal Processing', 'During his academic career of 14 years, Dr. Sachan has taught various subjects like Microwave Engineering, Digital Communication, Wireless Communication, Optical Communication, Optical Networks, Wireless Mobile Networks at UG/PG Level.', 'Dr. Sachan has published 9 papers in International Journal and 8 papers in National journal. Total number of citation of research papers of Dr. Sachan is 30 on November 2015. h-index and i10-index of research publications of Dr. Sachan  are  3 and 1 respectively.  He is on the editorial board of different International and National Journal.  ', 'Dr. Sachan has published 30 papers in proceedings of International / National conferences. 08 research papers of Dr. Sachan has been included in IEEE Xplore. ', 'He has authored 3 books ( Digital Electronics, Digital Logic Design and Miroprocessor), edited 02 conference proceedings and written 6 chapters in different books.', 'Along with being good teacher, Dr. Sachan has handled number of administrative assignments successfully and make exemplary contributions through his dedicated, committed and innovative approach with high integrity. He has organized 2 international conferences and 8 workshops/summer schools. He is the recipient of merit scholarship throughout education. Dr. Sachan has also received Letter of Appreciation for his contributions as Additional HoD and Coordinator of Administrative Assignments by Director General of KIET Group of Institutions, Ghaziabad and Director of KIET Group of Institutions,Ghaziabad respectively.    ', 'vaibhav.sachan@kiet.edu', '2015-05-27 10:34:01'),
