(8216, 'Dr. K.R. Chaturvedi obtained his MBA from Pune University, LL.B. from Utkal University and Ph.D from IIT, Kharagpur in the area of organizational behaviour (leadership). He carries with him 16 years of administrative experience at various capacities. He is in teaching for the last 16 years and attached with well reputed Institutes. He has published 14 research papers in reputed International/National journals and several papers in conferences. He has been convener of Research Doctoral Committee of , MTU Noida and also a member of Board of studies of Management. He has guided on Ph.D scholar of Utrakhand Technical University and guiding six Ph.D scholar of different University like UPTU Lucknow, UTU Dehradu, Indian School of Mine Dhanbad. He has chaired more than five National and International conference as theme speaker in India. He has conducted executive development pragramme as lead trainer in some of the organization like IREDA New Delhi, GAIL Jaipur etc. He has organized more than 10 Workshop/Conference/Seminar at National level.', 'Organizational Behaviour and Human Resource Management', 'Organisational Behaviour, Human Resource Management, Legal & Regulatory frame work, Industrial Relations, Labour Law, Team Building & Leadership, Communication, Leadership Effectiveness ', '(1)\'Emerging trends in leadership: An overview\' Business Research, ISSN Code 0972-2785, 3-11, (2003).\r\n(2)\'Impact of leadership styles on work behaviour of subordinates\' Productivity, Vol. 46, (1), 43-53 (2005).\r\n(3) Subordinates perception of leadership styles and their work behaviour, Psychology & developing Societies, Vol. 18, No. 1, 95-114 (2006)\r\n(4)Leadership styles and Indian ethics, Apeejay Journal of Management, Vol. 2 (1), 45-53 (2008).\r\n(5)Predominant leadership styles vary at different levels in an organisational hierarchy, International Journal of Management Science, Vol. 6 (1) 87-103 (2010).\r\n(6)Emotional Intelligence & Leadership in Indian IT industry: An empirical study. Accepted for publication in SAARANSH-RKG journal of Management, Vol. 3 (1) 66-70 (2011).\r\n(7)The influence of gender on emotional intelligence of professionals in Indian IT indusry. Accepted for publication in International journal of management science Vol. 7 (1), 5-18 (2011). \r\n(8)Role of self-ethicacy in intrinsic motivation & academic performance of teacher, Synergy Vol.10 (2), 63-71 (2012).\r\n(9)Identifying differences of the level of worry with GAD (Generalized Anxiety Disorder) based on Gender among Engineering Students using PSWQ (Pen State Worry Questionnaire) Indian Journal of Health and Well being Vol. 5 (3), 371-374 (2014).\r\n(10)Roll of commitment as intensive motivation in promoting quality education. Scholars\' views: International Journal of Media and Management Vol. 3, (1), 36-43 (2014).\r\n(11)Impact of intrinsic motivation on performance: A literature review of International journal of organization behaviour & management perspectives Vol. 3 (4) 1297-1306 (2014).\r\n(12)Blogs: Attitude and its impact on online shopping environment. A case of electronic product-study of Indian Consumers Business prospectus Vol. 14(1) 56-66 (2015).\r\n(13)The relationship between emotional intelligence and household stress submitted to globle business review, IMI New Delhi.', 'Organised: \r\n(1) Organised FDP on \'Human Value\' on 30 May 2010 at KIET in Dept. of Management Studies sponsored by UPTU.\r\n(2) Organized and AICTE Sponsored National Conference on Ethics in Business: in the era cut throat competition in KIET, Dept. of Management Studies on 17 Sept. 2011.\r\n(3) Organized an AICTE sponsored National conference on \'Rural Opportunity in India\' on 18 August 2012 in KIET, Dept. of Management Studies. \r\n(4) Organised Workshop on \'Consumer Protection and Consumer Welfare in India\" Sponsored by Ministry of Consumer affair Govt. of India held on 15-16 Feb 2013.\r\n(5) Organised Workshop on \'Consumer Protection and Consumer Empowerment in India\' sponsored by Ministry of Consumer Affair Govt. of India held on 28 Feb-1Mar 2014.\r\n(6) Organised FDP on the topic \'Employability Skills\' at KIET in Dept. of Management Studies sponsored by AICTE conducted by TCS (TATA consultancy services) on 9 Dec 2013.\r\n\r\nAttended:\r\n(1) Changing expectations from tomorrow\'s managers: An HR perspective, IPEM, Ghaziabad 24 Jan 2004.\r\n(2) Emerging challenges in HRM: Looking at the work place of today & tommow 9 Dec 2006 AIMT Gr. NOIDA.\r\n(3) HR professionals in global village: challenges & opportunities 14 Dec 2006 BIT NOIDA extension centre.\r\n(4) Integration of Human Values in Technical Education at UPTU NOIDa centre on 17 Nov 2008.\r\n(5) HR reloaded at BLSIM, Ghaziabad on 28th Mar 2009.\r\n(6) Amity Conference on Management course ACME - 2012 organised by Amity Business School on 2 Nov 2012.\r\n', 'Nil', '(1) Member of Board of Studies of Mahamaya Technical University, NOIDA (now UPTU).\r\n(2) Member of Board of Knowledge Management of Mahamaya Technical University, NOIDA (now UPTU).\r\n(3) Convener, Research Doctoral Committee of Mahamaya Technical University, NOIDA (now UPTU).', 'kr.chaturvedi@kiet.edu', '2015-05-27 13:02:16'),
