(11855, 'Prof. (Dr.) K. Nagarajan \r\n       \r\nDOJ: 18th August 2010 \r\n\r\nAffiliation: Department of Pharmaceutical Chemistry, KIET School Of Pharmacy\r\n     \r\nEducation: M. Pharm. (Gold Medalist) ( BIT, Mesra, 2001), Ph.D. (Jadavpur University, Kolkata, 2010) \r\n\r\nTotal work Experience: 14.5 yrs. (Academic: 13.5 yrs; Industry: 1 yr)\r\n\r\nPost Ph.D Experience: 5 yrs                \r\n\r\nInternational Honour: Selected for Colonel Fairleigh S. Dickinson International Scholarship of US 5000$ for 2005-06 year in recognition of candidate\'s potential & past educational achievements.\r\n\r\nProjects Guided: Guided 24 Projects for UG, PG and Ph.D students (3 persuing), 8 projects through Consultancy services and 6 projects through Industrial R & D.\r\n\r\nR & D Industrial Experience: worked as Scientist-II in MCD Drug Discovery Lab of Torrent Research Centre, Gujarat in 2001.\r\n\r\nOngoing Funded Research Project: Acquired a funded research project entitled \'Design and Development of novel peptidomimetics as potential anticancer agent\' under AICTE-RPS, Govt. of India  with a worth of 11 Lacs as Principal Investigator.\r\n \r\nInvited Guest Lectures: 7\r\n\r\nAdditional Responsibilities: Holds life membership in various Professional Bodies, Member of Editorial/ Reviewer Board of Various Journals, Question Setter & Panel member for Various Universities and National Coordinator/ Scientific Committee member of Various Conferences.\r\n\r\n', 'Drug Design, Natural product research, Antimicrobial Chemotherapy, Anticancer based Peptidomimetics    & Glycopeptides', 'Modern Analytical Techniques, Medicinal Chemistry, Pharmaceutical Analysis and Biochemistry', 'Published 50 Research Papers (International: 40; National: 10) in various reputed International & National Journals ', '23 Papers Presented (International: 2; National: 21); \r\n18 Conferences Participated (International: 4; National: 14) ', 'Authored 5 Books (in areas of Radioassays, Hyphenated Analytical Techniques, Fundamental Spectroscopical descriptors, Medicinal Chemistry and Biochemistry under Birla Publishers, New Delhi and LAP publishers, Germany)', '1. Qualified GATE\'99 with 93.33 Percentile (All India Rank: 190)\r\n\r\n2. Rewarded with i-Pad as Outstanding Faculty for Superior Performance in Academics on June2014\r\n\r\n3. R.S. Krishnan Award for General Overall Performance in XII standard\r\n\r\n4. Recipient of UGC Junior Research Fellowship, MHRD, Govt. of India from 1999-2001\r\n\r\n5. Research Advisor,Dr. Thangs Herbal Research Centre,Coimbatore from June 2010\r\n\r\n6. Qualified GRE & TOEFL Exam in 2002\r\n\r\n7. Ex-President, Pharmaceutical Society, BIT, from 2000-01', 'k.nagarajan@kiet.edu', '2015-05-25 14:41:20'),
