(11901, 'Brajesh Kumar Tiwari (B.Tech, M. Tech.) is Assistant Professor in Department of Electrical & Electronics Engineering. Presently he hold the position of  In-charge Examination cell in the Department. Mr. Brajesh Kumar Tiwari has more than 5 years of teaching experience in the field of Electronic circuits and Devices, Analog & digital Communication, Wireless Communication. He also works as a mentor for the students.', 'Electronic Circuits and Devices,  Analog & Digital Communication and Wireless Communication.', 'B.Tech & M.Tech.', '02', '01', 'NONE', '02', 'brajesh.tiwari@kiet.edu', '2015-05-29 12:19:15'),
(11906, 'Dr. Ashu Mittal, comes with a research and teaching experience of over 18 years. Dr. Mittal received his B.Pharm degree from University of Rajasthan, M.Pharm  from Government college of Pharmacy, Karad, MS. and Ph.D from Uttar Pradesh Technical University.Dr. Mittal has carried research in the areas of pharmaceutics, drug delivery systems, and analytical method development.He has supervised over 30 post graduate students. Dr Mittal has over forty publications to his credit in foreign/international  journals of high scientific impact like Biological and Pharmaceutical bulletin, Japan; Pharmaceutical Development and technology, USA; Journal of dispersion science and technology, UK; Journal of Analyatical chemistry, Russia; Current drug delivery (Bentham) etc to name a few. He has numerous publications to his credit in Indian journal of repute. Dr Mittal is a member of national and international associations. He also serves as the reviewer of several Indian and foreign journals. Dr Mittal has carried out collaborative research with pharma industries.', 'Biopharmaceutics; Pharmacokinetics; Transdermal & Buccal therapeutic systems, Analytical Method Development; Conventional and sustained release dosage form development,Microspheres', 'Biopharmaceutics and Pharmacokinetics, Pharmaceutical Biostatistics, Pharmaceutical Technology, Drug Regulatory affairs, Product Development, Novel  drug delivery systems,  Hospital Pharmacy, ', 'Dr Mittal has published over forty original research articles in foreign /international journals  of high scientific impact. ', 'Participated in more than 30 conferences, symposium, workshops.', 'N/A', 'Received best lecture presentation and write up awards by previous employers. Qualified  GATE in 1997 by IIT Madras. Qualified TOEFL exam in 1997. Marquis Who\"s who selected biography in science and engineering (2011-2012) 11th edition. Reviewer of well-known foreign journals. Panel member for Ph.D and other professional examination of various university. He is life members of various professional organization (APTI, IHPA, IPGA, ). Overall coordinator (Teaching & learning process, KSOP), Member , Internal quality assurance cell,KSOP\r\nEx -Joint Secretary, APTI (UP Branch)', 'ashu.mittal@kiet.edu', '2015-05-25 14:19:58'),
