(11909, 'Rekha Singh is a dynamic lady who has proved to be good decision taker in complex situations, leadership skills with great team management capabilities and sound interpersonal skills. She is a lady full of energy and enthusiasm. She is confident and optimistic persona. She believes in walking on haphazard road since she wants to craft her own way by orderly organising the road that leads to her destination.\r\n\r\nAcademically, she always stood in top five at school and college level. She is B.Sc. Zoology (H) graduate from Delhi University, India and did MBA (specialised in HR) in 1999. She has always participated in extra-curricular activities and won medals.\r\nProfessionally, she has vast and rich experience in HR. She feels herself fortunate since industry gave her an experience to work in various verticals ( Manufacturing, Hospitality, Service, IT and Education) providing her rich and valuable experience. She has learnt things on her own and conceptualised, designed, implemented the \"Best HR Practices\" with her own hand.\r\nHence, today she feels that her methodology of researching, understanding things from depth, designing, introducing, implementing and continuously improving the HR function from all angles based on market, business, employee and dynamic situation need make herself a very strong conceptually, dynamic, versatile, business and employee growth focussed.\r\nHer attitude to learn fast, compete and excel in HR domain with total alignment in business and employee growth led her rewarding career graph.\r\nThis is just the beginning; she has to achieve a lot in HR function with her dedication, determination, perseverance nature and entrepreneur skills.\r\nAcademe:\r\nMBA (Major in HR and Minor in Marketing) from Maharishi Dayanand University, Haryana in 1999 - Secured 75%\r\nB.Sc. (Zoology - H) from Zakir Hussain College, Delhi University in 1997, topper of \"History of Science\"\r\nXIIth (PCM+B) - DAV Public School, Ghaziabad in 1994 - Distinction in Maths, Physics, English & Biology - Secured 80.2%\r\nXth - DAV Public School, Ghaziabad in 1992 - Distinction in all subjects (Maths, Science) - secured 76.7%\r\nRest education done from Airforce School, Army Public School and Central School at various places of India\r\nDOB: 28th June, 1975', 'Research papers on \"Human Capital Management\" and \"Mentorship, Counselling & Coaching : Emerging Trends\" written and presented at International Conferences - organised at India Habitat Centre, Lodhi Road and RATM - Mathura \r\nRegular writer of latest HR articles', 'During the profession as faculty in department of MBA, taught - Organisational Behaviour, HRM,Industrial Relations to courses MBA, MCA and BBA in year 2005-06', 'Not applicable', 'Attended Seminars on Best Benchmarking HR Practices, Self Development, \r\nTrainings attended on \"PCMM\" by Bill Curtis organised by QAI,Delhi\r\nTraining on \"Assessment centres on Competency mapping\" organised by CII, Mumbai\r\nTraining on :Certified Recruitment Analysis\" by Middle Earth Consultants, CAMI Certifications\r\nTraining in CMM/CMMi/PCMM Model', 'Not applicable', 'Extra-Curricular Activities:\r\nSilver medal in \"National Talent Search\" in Science & Mathematics\r\nScored 95 out of 100 in Biology in 12th standard - Highest at school level\r\nCompleted foundation level of \"Company Secretarial - CS - Course\" in 1999\r\nDone basic level e-Commerce course\r\nAlways an active member in Sports events\r\nActive participation and won medals in Dance Competitions (Semi Classical) from school to management college level\r\nParticipated in Debate, Quiz, Elocution Competitions and w', 'rekha.singh@kiet.edu', '2015-05-27 10:20:03'),
