(13527, 'Dr. J. Girish obtained his Doctoral degree in Civil engineering with specialization in Structural engineering from IIT Kharagpur (in 2005), the premier Technological Institute in the country. He has more than 20 years of industrial, teaching and research experience.', 'Nonlinear stability of composite plates and shells; computational Mechanics.', 'Engineering Mechanics, Strength of Materials, Structural Analysis, Design of Concrete and Steel structures and Finite Element Analysis.', 'Outstanding publications in peer reviewed International Journals are: ASME Journal of Applied Mechanics, ASCE Journal of Engineering Mechanics, ASCE Journal of Aerospace Engineering, Journal of Sound and Vibration, Journal of Thermal Stresses and Composite Structures.', 'International Conferences: International Congress of Theoretical and Applied Mechanics, Warsaw, Poland; Mechanics of Functional Materials and Structures, IIT Delhi; Vibration engineering and technology of machinery, BAARC Mumbai.', 'Reviewed Strength of Materials by S.S. Ratan, Tata McGraw-Hill. ', 'He has received best teacher award in the year 1999 at VIT, Vellore. Coordinated TEQIP project for three years, funded by World Bank. Delivered invited lectures at NSTL (DRDO Ministry of Defence), NTPC, Noida and Chaired conference proceedings at NIT Warangal.', 'j.girish@kiet.edu', '2015-06-10 11:14:47'),
