(14219, 'I have 4 years of academics experience and have been handling anatomy, physiology and pharmacology. I have deep interest in cardiovascular, neuro behavioural and gastrointestinal pharmacology. \r\nMy approach for teaching is to breakdown the topic as much as possible and relate it to the phenomenon that have been observed in daily life.  ', 'I have my specialization in in-vitro system with human skin cell line cultures and phototoxicity assessment of xenobiotics with photochemical and molecular biology techniques. Currently I am pursuing my PhD in the area of dementia associated with several metabolic disorders. ', 'Human anatomy and physiology (I and II year B.Pharm.)\r\nPharmacology-II (B.Pharm)\r\nAdvanced Pharmacology- (M.Pharm.)\r\nClinical Pharmacology and Drug Interactions (M.Pharm.)', 'None', 'Attended more than 10 conferences.\r\nPresented an oral paper at entitled \"Propitious role of Chlorogenic acid in arsenic neurotoxicity induced endothelial dysfunction and vascular dementia in rats\" at IPSCON-2013 held at NIMHANS convention center, Bangalore.', 'None', 'Guided two M.Pharm. students for their dissertation work.\r\nGuided B.Pharm. students for annual techfest \"SPIRIT\" held at IIT-BHU for past three consecutive years where they have secured top postions.', 'himanshu.aggarwal@kiet.edu', '2015-05-29 11:19:44'),
