(15178, 'Ms. Poonam Rana is working as Assistant Professor since 2012. She has Completed her B.Tech ( IT) from ABES Engineering College, Uttar Pradesh Technical University  in  2010 and M.tech(CSE) from Jaypee University of Information Technology, Waknaghat, Himachal Pradesh in 2012. She  is Pursuing Phd from A. P. J. Abdul Kalam University ,Lucknow,Uttar Pradesh.She has 4 yrs of experience in academics.Her area of Interest includes Computer Networks,Cloud Computing and Big Data.\r\nShe has  jointly published various Research Papers in International Journal and International Conferences.She has also served as Technical Program Committee  in International Conference CGVIS 2015(Computer Graphics ,Vision and Information Security).', 'Computer networks, Data Structures ,Cloud Computing.', '1. Data Structures Using C.\r\n2. Computer Networks\r\n3. Digital Image Processing\r\n4. Information Security and Cyber Law\r\n5.Total Quality Management\r\n6.Parallel Algorithms\r\n7. Software Project Management \r\n8. Computer System and Programing in C', '1.\" Remote Mirroring  a Disaster Recovery Technique in Cloud Computing in IJARSE VOL NO-2 ISSUE NO-8 , August 2014, pg no 166-175 ISSN-2319-8354(E)\r\n2.\" Juxtaposition of load balancing algorithms in cloud computing using cloud analyst simulator\" in International Journal of Computer Applications.\r\n3.\" Cloud Computing Overview Services and Features in Academic Science Journal\r\n4.Combined  and Improved framework of IaaS and PaaS in Cloud Computing \" in Springer Journal of Advances in intelligent and soft computing.\r\n5.\" A Parametric Analysis of Cloud Computing Security Models and Threats in  International Journal of Computer Applications ,VOL-133,ISSUE NO-13 ISBN 973-93-80890-79-1),JAN 2016\r\n6. \" Cluster Based Routing Schemes in Wireless Sensor Networks:  A Comparative Study\", in International Journal of Computer Applications,VOL-125,ISSUE13,September 2015.\r\n', '1.\"Comparative Analysis of Pattern Matching Methodologies\" in ICICT 2014 IEEE Conference and published in IEEE xplore.\r\n2.Revolution in Requirement Analysis by using Association Rule Mining in ICCCCM 2013  IEEE Conference at United Campus Naini Allahabad.\r\n3.Wireless communication an Application in Smart Grid an Overview in CIPECH 2014 IEEE Conference  and also published in IEEE xplore.\r\n4.Position Based Routing Schemes in Wireless Sensors Networks: A Comparative Study  in CICT IEEE CONFERENCE 2016 at ABES Engineering College.\r\n5. Combined and Improved Framework of IaaS and PaaS in cloud computing socspros 2012 springer conference at J.k Lakshmipat University Jaipur.\r\n6.Enchaned Energy Optimization in wireless mesh network using Cluster point in NGCT 2015 IEEE Conference  at University of Petroleum and Energy Studies.', 'none', 'B.tech( Hons)  in Information Technology.\r\nSecured 9.4 CGPA in M.tech(Computer Science and Engineering)\r\nReceived Appreciation for organizing Frescos and Literary Fest.\r\nWorked as Reviewer in Technical Program Committee   in CGVIS 2015\r\n\r\n', 'poonam.rana@kiet.edu', '2015-06-02 14:25:26');
