(15298, 'After completing Engineering studies, joined Indian Railways Service for Electrical Engineering (IRSEE) through Union Public Service Commission. During 35 years with IR dealt with Traction Sub-station design and maintenance, Design and maintenance of Traction & Distribution System, Manufacture and Maintenance of Electric Locomotives, General Power Supply, Air-conditioning, Train Running, Training of IRSEE Probationers etc.\r\nAssociated with KIET for the last two & a half years.', 'Specialize in the field of Sub-station design & erection and Traction & Distribution System design. I was leader of the team who, for the first time in the world, designed, erected, commissioned and successfully tested the 25 kV Over Head Equipment for double-stack container movement  in presence of Japanese Railway Engineers', 'Electrical Engineering to the freshly admitted First Year students', 'Co-authored an  article on movement of Double Stack Containers in Electrified Territory, which appeared in International Railway Journal (IRJ).', 'Attended many conferences organized by the Railways.', 'None', 'Very many during my service with IR.', 'rajiv.mehta@kiet.edu', '2015-06-04 14:53:37'),
