(20720, 'Mr Naveen k. yadav completed his B. Tech in Electronics and Communication Engineering from GBTU, Lucknow in 2010 and M. Tech from NIT Jalandhar in 2015.  He has more than 3 years of teaching experience.\r\n\r\n', 'Smart grid and wireless communication', 'Data communication networks, Satellite communication, Basic electronics, Soft computing.', '[1] Naveen Kumar, Neetu Sood, \" Application of compressed sensing in cognitive radio,\" Advances in Intelligent Systems and Computing, Springer, pp 107-117, 2016 (ISSN 2194-5357).\r\n[2] Naveen Kumar, \"Application of Compressed Sampling for spectrum sensing and channel estimation in cognitive radio,\" International Journal of Computer Networks and Communication (IJCNC), vol. 7, no. 5, pp. 39-55, 2015 (ISSN 0974-9322). \r\n[3] Naveen Kumar, Neetu Sood, \"Compressed channel estimation for wideband cognitive radio,\" Journal of Basic and Applied Engineering and Research, vol 2, no. 10, pp. 830-834, 2015 (ISSN 2350-0255).', '[1] Naveen Kumar, Neetu Sood, \"A fuzzy neural network based reasoning and learning approach for efficient spectrum management in cognitive radio,\" IEEE International Conference on Signal Processing, Computing and Control (ISPCC), Shimla, pp. 365-370, 2015\r\n[2] Naveen Kumar, Neetu Sood, \"Fast and efficient compressed spectrum sensing for wideband cognitive radio network\" 2nd IEEE International Conference on Recent Trends in Information System (ReTIS), Kolkata, pp. 87-91, 2015\r\n[3] Neha Prajapati, Naveen Kumar, \"Data flow based quality testing approach using ACO for component based software development,\"   2nd IEEE International Conference on Computing, Communication and Automation (ICCCA), Greater Noida, 2016. ', 'NONE', 'Qualified GATE in the year 2011, 2013 and 2014.\r\nQualified NET in the year 2015.', 'naveen.kumar@kiet.edu', '2016-01-15 03:36:09'),
(20721, 'Er. Rajeev Kumar Assistant Professor EN Department. He did his B.Tech from MDU ROHTAK in 2012. He is Three Times GATE Qualified . He did his M.Tech from Govt. Engg. College Murthal (DCRUST MURTHAL MAIN CAMPUS) in 2015. His area of interest is Power System Dynamics, Machine & FACTS.', 'Power System Dynamics & Control', 'Basic Electrical ,Electric Machines & Power System', 'Manuscript Sent to IEEE & IET Journals', 'None', 'None', 'Three Times GATE Qualified', 'rajeev.kumar@kiet.edu', '2016-02-14 22:20:13'),
