(20723, 'Prof. Manoj Badoni did his B. Tech. from HNBGU Srinagar Garhwal, M.E. from PEC Chandigarh and Ph.D from DTU Delhi. His research interest include Power Quality and Distributed Generation. He has published eight papers in various journals, which include IEEE Transactions, IET, Taylor and Francis, Wiley and Springer. He has received prestigious POSOCO Power System award in 2016 for contributing research in the field of power system. ', 'Power Quality and Power Electronics ', 'Electrical Measurement and Measuring Instrument\r\nPower Electronics\r\nBasic Network Analysis\r\nDigital Computer and Microprocessors \r\n ', '8', '10', 'None', '3', 'manoj.badoni@kiet.edu', '2016-03-28 23:37:30'),
(20725, 'Working as Assistant Professor in department of mechanical engineering. \r\nM.Tech in Hydro power Engineering from M.A.N.I.T, Bhopal with 8.85 C.G.P.A IN 2014\r\nB.Tech from S.I.E.T, Greater Noida affiliated to G.B.T.U , L ucknow  with 74.4 marks in 2010.', 'Hydraulic Machines, Fluid mechanics.', 'Fluid Machinery, Fluid Mechanics, Basic Manufacturing Processes', 'none', 'Presented a paper on Stress analysis of Pelton Bucket using mechanical APDL in ARIMPIE-2015 organised by I.T.S.E.C, Greater Noida', 'none', 'First prize in machine design , Technical Quiz at college level.\r\nFirst Prize in essay writing and dance competition at school level.', 'sonendra.sharma@kiet.edu', '2016-03-10 03:00:32'),
(20726, 'I did my B-tech from Moradabad Institute of Technology Moradabad and M-tech from IIT delhi', 'THERMAL ENGINEERING', 'Heat and Mass Transfer ,Refrigeration and Air conditioning, Fluid Machinery, Mechanical System Design,Quality management', '\"Ion cell performance using single particle representation of battery electrode\" volume 768 page 11-14 Journal of electro analytical chemistry (ELSEVIER)', 'Design and modelling of unmanned ground vehicle poster presentation at (STME 2013) Delhi Technical university Delhi\r\nStudy of Lithium ion cell using single particle electrode (RAMCE 2014) AKGEC GHAZIABAD', 'NONE', 'NONE', 'raja.ra.@kiet.edu', '2016-03-08 21:45:56'),
(20727, 'He has received his B.Tech (IT) and M.Tech (CE) from MDU, Rohtak in 2006 and 2009 respectively. He has submitted his doctoral thesis on the topic \"Development and Implementation of new hybrid Algorithm for Data Mining Task using Nature Inspired Algorithm\" in the Department of Computer Science and Engineering, Birla Institute of Technology, Mesra, Ranchi, Jharkhand. He has taught in various colleges affilated to MDU, Rohtak and KU, Kurukshetra. His primary research area include application of nature inspired algorithm, data clustering, feature selection, bioinformatics, medical data mining and numerical function optimization. He has published more twenty four research papers in different international journal like progress in artificial intelligence (springer), soft computing (springer), ai communications (IOS press), inderscience journals and other journals of repute. He has published nine papers in various national/international conferences  and also published three book chapter in edited book published by springer and IGI global publishers.', 'Nature Inspired Algorithm, Data Clustering, Feature Selection, Medical Data Mining, Function Optimization', 'Compiler Design, Automata Theory', '24', '9', '01', 'No', 'yugal.kumar@kiet.edu', '2016-04-01 03:52:31'),
(20728, 'Mr. Rikeshwer Prasad Dewangan is pursuing Ph. D. in Pharmaceutical chemistry as MOU candidate from CSIR- Institute of Genomics and Integrative Biology (IGIB), Delhi and Jamia Hamdard (Hamdard University) Delhi. Mr. Dewangan received his B. Pharm. from Guru Ghasidas Vishwavidyalaya (Central University) Bilaspur (C.G.) in 2009 and M. Pharm from IIT- BHU Varanasi (U.P.) in 2011. He has four years of research experience as Senior Research Fellow in CSIR-IGIB. Mr. Dewangan has carried research in the area of peptide chemistry for the discovery of antimicrobial peptides against multidrug resistant pathogens. He has published four research paper in high reputed international journals with cumulative impact factor of 26.2.  He is a member of several national and International organizations and reviewer of numerous national and international journals.  ', 'Peptide Synthesis (solid and solution phase), Design of peptide therapeutics, Drug Delivery, Infectious Disease, Analytical Chromatographic techniques (HPLC, LC-MS/MS)', 'Medicinal Chemistry', '1. Seema Joshi, Rikeshwer Prasad Dewangan, Mohammad Sahar Yar, Diwan S. Rawat, Santosh Pasha. N-terminal aromatic tag induced self assembly of tryptophan arginine rich ultra short sequences and their potent antibacterial activity. RSC Advances, 2015, 5, 68610-68620. (Impact Factor- 3.84)\r\n2. Rikeshwer Prasad Dewangan, Seema Joshi, Shalini Kumari, Hemlata Gautam, Mohammad Shahar Yar, Santosh Pasha. N-terminally modified linear and branched spermine backbone di-peptidomimetics against planktonic and sessile methicillin resistant S. aureus. Antimicrobial Agents and Chemotherapy, 2014, 58, 5435-5447. (Impact Factor- 4.57)\r\n3. Atul Kumar, Sanjiv Kumar, Dilip Kumar, Arpit Kumar, Riikeshwer Prasad Dewangan, Priyanka Shrivastava, S. Ramachandran, Bhupesh Taneja. The structure of Rv3717 reveals a novel amidase from Mycobacterium tuberculosis. Acta Crystallogr. D. Biol. Crystallogr. 2013, 69, 2543-2554. (Impact Factor- 14.1)\r\n4) Seema Joshi*, Rikeshwer Prasad Dewangan*, Shruti Yadav, Diwan S. Rawat, Santosh Pasha. Synthesis, antibacterial activity and mode of action of novel linoleic acid-dipeptide-spermidine conjugates. Org. Biomol. Chem. 2012, 10, 8326-8335. (Impact Factor- 3.69, *Co-first author) \r\n\r\nPatent Filed-\r\nSantosh Pasha, Rikeshwer Prasad Dewangan, Seema Joshi. N-terminally modified linear and branched polyamine conjugated peptidomimetics as antimicrobial agents. US Patent application file no. 14/754,002, Dated 29-06-2015.', '1) Gordon Research Conference Italy, 2015.\r\n2) UK- India MedChem Congress, Hyderabad 2013.', 'None', '1) SERB- DST travel grant for GRC Italy\r\n2) Carl Strom Diversity International Fellowship 2015\r\n3) ASM Student Travel award 2015\r\n4) Gate qualified 2009 with AIR- 72', 'rikeshwer.dewangan@kiet.edu', '2016-03-04 23:22:17'),
(20729, 'I have completed my M.Tech (spec. in software engineering) from Aligarh Muslim University Aligarh in 2009 and B.Tech (IT) from UPTU lucknow in 2007. I have three years teaching experiance.My carrier objective is to establish myself in the field of education, to utilize my skills and experiance to help student to achieve high improvements in academics\r\n', 'Personalize web search engine and image processing', 'B.Tech and MCA', 'NONE', 'International Conference-04', 'NONE', '*GATE 2007\r\n', 'tanushi.bhardwaj@kiet.edu', '2016-03-29 04:07:50'),
