(20732, 'Sanjeev Kumar Dwivedi is an Assistant Professor in IT Department of KIET since 14, Jan 2016.He received his MTech in Distributed Computing System (DCS-CSE) from Pondicherry Engineering College (PEC), Pondicherry University. ', 'Distributed Computing, Information Security.', 'Information Theory and Coding, Computational Science, Database Management System,Analysis and Design of Algorithms.', '1 paper in  international Journal.\"ACEEE  International Journal on Recent Trends in Engineering and Technology\" A Dynamic Botnet Detection Model Based on Behaviour Analysis .', '1 paper in International Confertence. \"IEEE International Conference on Computational Intelligence and Computing Research\" Ratification Strategy for web services Composition using CPN.', 'NONE', 'GATE  AND NET QUALIFIED.', 'sanjeev.dwivedi@kiet.edu', '2016-04-04 23:26:24'),
(20733, 'I have done my M.Tech. from NIT Hamirpur in 2011 and B.Tech. from PTU Jalandhar in 2007.I have worked in Sharda Group of Institutions for four and half years as an Assistant Professor in EN Department. ', 'Signal Processing and Control', 'Digital Signal Processing, Control Systems , Electromagnetic Field Theory.', '1) Paper named \" Dead Time Compensators for Stable Processes\" published in JAIR (Journal of Academia and Industrial Research)', '1) Presented one paper named \" Analysis of Processes with Long Dead Time\" in an International conference held in MIT Moradabad.\r\n2) Paper named \"Analysis of Industrial Processes with Dead Time\"selected in international conference on Porous Media and its applications in Science and Engineering,Postdam,Germany.\r\n', 'None', 'None', 'varun.sharma@kiet.edu', '2016-03-05 02:02:27'),
(20734, 'I have completed my M.tech from IIT Guwahati in the field of Fluid and Thermal Engineering in 2015. My CGPA of M.tech is 7.76.\r\nI had completed my B.tech from SIRT Bhopal (RGPV University) in mechanical engineering in 2013. My marks percentage is 73.59 in B.tech.', 'Specialisation- Fluid and Thremal Engineering. \r\nMy project comprises the analysis of density inversion of water in a lid driven cavity. For the analysis , a Finite Volume Solver (FVM) is developed in FORTRAN 90 programming language using SIMPLE algorithm. Steady state mixed convection of water  near its density inversion in single and double lid driven rectangular cavity were studied.', 'Machine Design II', 'na', 'na', 'na', 'GATE-2013 (qualified)\r\nGATE-2014 (qualified)\r\nGATE-2015 (qualified)', 'gaurav.kumar@kiet.edu', '2016-03-10 21:17:15'),
