(20747, 'Prof. (Dr.) Jagannath Sahoo\r\nM. Pharm., Ph.D., FIC\r\nDate of Birth: 21st June, 1969\r\nDate of Joining: 16th May, 2016\r\nTeaching Experience: 23 Years\r\nPG Project Guided: 25\r\nPhD Project Guided: 04\r\nQualification Details:\r\nPh.D. (2008) Biju Patnaik University of technology, Orissa, Rourkela\r\nM.Pharm. (1996) Birla Institute of Technology & Sciences, Pilani\r\nB. Pharm. (1992) Berhampur University', 'Pharmaceutics, Controlled release drug delivery system', 'B. Pharm., M. Pharm.', 'Research Publications: 31', 'Paper Presentation: 22', 'None', '1. 1st President of APTI state Branch.\r\n2. Speaker in various faculty development programs.\r\n3. Convener of National seminar at SRMS, Bareilly.\r\n4. Convener of many Training programs/Seminars/', 'jagannath.sahoo@kiet.edu', '2016-06-04 04:13:17'),
(20750, 'Dr. Manoj Kumar Gupta received the PhD in Computer Science and Engineering from Indian Institute of Technology Roorkee, Roorkee. He completed B.E(CSE) in 2001 from CCS University Meerut and M.Tech(CSE) in 2009 from HBTI Kanpur (Affiliated with UPTU Lucknow). Currently he is working as  Associate Professor in the Department of Computer Science and Engineering. He has been in teaching for more than 11 years and 3.5 years of research experience. He is supervising 3 PhD scholars and guided many M.Tech dissertation and B.Tech projects. He has been the reviewer and committee member of various International and National journals and International conferences.', 'Bioinformatics, Data mining, Algorithms and Computational Biology', 'Design and analysis of algorithm, Data Structure, Data mining, Object oriented programming, Programming in C, Operating System, Object Oriented Modelling, E-commerce, Artificial Intelligence, ', 'International Journals: 07 (SCI Indexed: 03)', 'International Conferences: 08\r\nNational Conferences: 03', 'NONE', '1) Received scholarship from Ministry of Human Resource and Management (MHRD) while working    \r\n    as research scholar at IIT Roorkee, Roorkee.\r\n2) Travel grant fro the Department of Science and Technolgy (DST), CSIR and Microsoft Research grant.\r\n3) Deputed as an expert member of UPTU inspection team in Dec 2003.\r\n4) Deputed as an expert in district level Investigation committee by UP state govt. in 2003.\r\n', 'manoj.gupta@kiet.edu', '2016-08-09 22:58:53'),
(20751, 'Dr. Vivek Dubey is joined as Computer Science & Engg. Dept. in Computer. He has 17 years experience in academics. He has completed Ph.D. (CSE), M.Tech. (CT) and B.E.(CSE).', 'The research area includes Natural Language Processing (NLP), text Data Mining, Object Oriented Analysis and Design', 'B.Tech., M.Tech.,M.Sc.(CS and IT) and MCA', 'Published 17 papers in International Journal and 5 paper in National Journal', 'Published 3 papers in International Conference and 26 papers in National Conference ', 'None', 'Passed M.Tech. with Honours, 2002\r\nDeputed as Asst. Examination coordinator for SAIL Exam, Railway Exam, MP-PSC Exam\r\nDepouted to the IIIT Hyderabad for 40 days for smooth functioning of Practical Training program for 08 students of BE (CSE) Branch\r\nM.Tech Project Guided - 8 Students and Two scholars are pursuing Ph.D. from Pracific and Mewar University, Rajasthan\r\nOrganized two-day National Multi Conference at LNCT Indore on 26th-27th April, 2014.\r\nCertificate of First Prize in Research Paper Presentation, Technologia-2003, at MPCCET, Bhilai, 29-30 March 2003.\r\nLife member of \"The Indian Society for Technical Education\", ', 'vivek.dubey@kiet.edu', '2016-08-16 07:53:29'),
(20752, 'Dr. (Prof.) Ajay Agarwal is a versatile professional with a strong academic background. Presently he is working as Professor in Information Technology Department. He has done his B. Tech. (Computer Sc.) from I.E.T. Lucknow (a constituent  college of Dr. A.K.T. University, Lucknow), M.E. with honors (CSE) from M.N.N.I.T. Allahabad and Ph.D. from I.I.T. Delhi.', 'Computer Networking, soft computing.', 'Theory of Automata and Formal Languages, Discrete Structure, Compiler Design, Computer Networks, Data Structure, Digital Organization, C Programming , Operating System etc.', '14', '17', '1', '10', '', '2016-07-29 14:28:09'),
(20770, 'Ms. Monika Bhardwaj\r\nM.Pharm. (pharmacology)\r\nDate of Birth: 11-07-1992\r\nDate of Joining: 29-08-2016\r\nQualification Details:\r\nM.Pharm. (2016) Baba shaheb Bhimrao Ambedkar University ( A Central University), Lucknow\r\nB.Pharm. (2014) KIET School of Pharmacy,Ghaziabad- UPTU, Lucknow\r\n', 'Pharmacology/ Anatomy, Physiology  and Pathophysiology', 'B.Pharm.', 'Publication: International (1)', 'conferences/seminars Attended: 7, Paper presented :4', 'None', 'University Merit holder in B.Pharm. (8th rank)\r\nGPAT Qualified (2014,2015,2016)', 'monika.bhardwaj@kiet.edu', '2016-08-31 20:42:56'),
(20771, 'Dr. Ashok Jangra\r\nDOJ: 29th August, 2016\r\nAffiliation: Department of Pharmacology, KIET School of Pharmacy\r\nEducation: M.S. Pharm. (NIPER-S.A.S. Nagar, 2010-2012), PhD (NIPER-Guwahati, 2012-2016)', 'Behavioural and Molecular Pharmacology, Neurotoxicology', 'B.Pharm, M.Pharm', 'NONE', 'Oral presentations (International Conferences: 2, National Conferences: 3)\r\nPoster presentations (International Conference: 1, National Conferences: 1)', 'Research Articles in peer reviewed journals: 16 (9 as a first Author)\r\nReview Articles in peer reviewed journals: 4', '1. Received International Travel Grant (2015) from Department of Science and Technology (DST), Govt of India, for attending \"Japan Neuroscience Society\" Conference held at Post Island, Kobe, Japan.\r\n2. Received International Travel grant (2015) from Indian Council of Medical Research (ICMR), Govt. of India, for attending \"European College of Psychopharmacology\" conference held at Amsterdam, The Netherlands.\r\n3. Received International Travel grant (2016) from International Brain Research Organisation (IBRO) for attending \"International Neurosicence Winter Conference\" held at Solden, Austria.\r\n4. Awarded scholarship from Ministry of Chemical and Fertilizers, Govt of India, for PhD degree at NIPER-Guwahati.\r\n5. Awarded scholarship from Ministry of Chemical and Fertilisers, Govt of India for PhD at NIPER-Guwahati.\r\n6. Awarded Scholarship from Ministry of Chemical and Fertilisers, Govt. of India for M.S. (Pharm) at NIPER-S.A.S. Nagar.\r\n7. Qualified NIPER-PhD Entrance Exam with 7 Rank.\r\n8. Qualified NIPER-M.S. Entrance Exam with 127 Rank.\r\n9. Qualified GPAT Exam with 282 Rank.\r\n', 'ashok.jangra@kiet.edu', '2016-09-03 01:36:42');
