INSERT INTO `contest` (`sno`, `question`, `successful`, `submittion`, `user`, `problem`, `input`, `output`) VALUES
(1, 'Reverse', 3, 25, '*E-learning*sandeep.1310128*shivam.1513091', 'Reverse digits of an integer.\n<br><br>\nExample1: x = 123, return 321<br><br>\nExample2: x = -123, return -321', '-5471', '-1745'),
(2, 'Add Two Number', 2, 5, '*E-learning*deepshikhar.1510043', 'You are given two linked lists representing two non-negative numbers. The digits are stored in reverse order and each of their nodes contain a single digit. Add the two numbers and return it as a linked list.The size of linked list is fixed i.e 3\n<br><br>  Sample:<br>\nInput: (2->4->3) + (5 ->6->4)<br>\nOutput: 7->0->8', '3 6 6 4 5 2', '7->1->9'),
(3, 'Integer To Roman', 1, 4, '*E-learning', 'Given an integer, convert it to a roman numeral.\n<br><br>\nInput is guaranteed to be within the range from 1 to 3999', '3894', 'MMMDCCCXCIV'),
(4, 'Decode Password Ways', 1, 2, '*E-learning', 'A message containing letters from A-Z is being encoded to numbers using the following mapping:\r\n<br>\r\n\'A\' -> 1<br>\r\n\'B\' -> 2<br>\r\n...<br>\r\n\'Z\' -> 26<br>\r\nGiven an encoded message containing digits, determine the total number of ways to decode it.<br>\r\n<br>\r\nFor example,<br>\r\nGiven encoded message \"12\", it could be decoded as \"AB\" (1 2) or \"L\" (12).\r\n<br>\r\nThe number of ways decoding \"12\" is 2\r\n\r\n\r\n<br>\r\nSample:<br>\r\nINPUT:263<br>\r\nOUTPUT:BFC,ZC,2', '2734', 'BGCD,1'),
(5, 'DUPLICATES', 1, 1, '*E-learning', 'Given an array of integers,<br> find if the array contains any duplicates. Your function should return number of duplicate element if any value appears at least twice in the array, and it should return 0 if every element is distinct.<br>\n<br>\n1.First line contain no to array elements<br>\n2.Second line contain inputs seprated by space<br>\n<b>Sample:</b><br>\nInput:<br> 11 <br>10 20 30 40 10 10 101 30 50 10 40<br>\nOutput:<br>10,4/30,2/40,2\n<br>\n', '12 20 20 20 20 10 10 10 10 8 8 9 12', '20,4/10,4/8,2');
