(16, '1', 'sandeep.1310128', '#include<bits/stdc++.h>\nusing namespace std;\nint main()\n{\n  string s;\n  cin>>s;\n  if(s[0]==\'-\')\n  {\n  reverse(s.begin()+1,s.end());\n    cout<<\'-\';\n  for(int i=1;i<s.size();i++)\n    cout<<s[i];\n  }\n  else\n  {\n    reverse(s.begin(),s.end());\n    cout<<s;\n  }\n  return 0;\n}', 'Accepted', 'source'),
